import React from "react";
import {  Nav, NavLink, NavMenu } from "react-router-dom";


const Navbar = () => {
    return (
        <>
          <Nav>
            <Bars />

            <NavMenu>
              <NavLink to='/' activeStyle>
                Home
              </NavLink>
              <NavLink to='/test' activeStyle>
                Test
              </NavLink>

            </NavMenu>
            <NavBtn>
              <NavBtnLink to='/signin'>Sign In</NavBtnLink>
            </NavBtn>
          </Nav>
        </>
      );
}
export default Navbar
